import {useState, useEffect} from "react"
import axios from "axios"

import InputTodoItem from "./InputTodoItem"
import DisplayTodoList from "./DisplayTodoList"
import OpenAIRequest from './OpenAIRequest';

import React from 'react';
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom';

// Import or define your page components
import Home from './home';

import "./App.css";

function App() {
    // State and effects for your components can go here if needed

    return (
        <Router>
            {/* Navbar: */}
            <nav>
                <ul className="navbar">
                    <li className="nav-item">
                        <Link to="/">Home</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/input-todo">Input Todo</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/display-todo">Display Todo</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/openai-request">OpenAI Request</Link>
                    </li>
                </ul>
            </nav>

            {/* Route configuration: */}
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/input-todo" element={<InputTodoItem />} />
                <Route path="/display-todo" element={<DisplayTodoList />} />
                <Route path="/openai-request" element={<OpenAIRequest />} />
            </Routes>
        </Router>
    );
}

export default App;
